  ,allDay                                     BOOLEAN  NOT NULL
  ,serviceswheelchairserviceCapability        VARCHAR(11) NOT NULL
  ,serviceswheelchairserviceActivity          VARCHAR(11) NOT NULL
  ,servicesblindserviceCapability             VARCHAR(11) NOT NULL
  ,servicesblindserviceActivity               VARCHAR(11) NOT NULL
  ,servicesnfcForBankCardsserviceCapability   VARCHAR(9) NOT NULL
  ,servicesnfcForBankCardsserviceActivity     VARCHAR(11) NOT NULL
  ,servicesqrReadserviceCapability            VARCHAR(11) NOT NULL
  ,servicesqrReadserviceActivity              VARCHAR(11) NOT NULL
  ,servicessupportsUsdserviceCapability       VARCHAR(11) NOT NULL
  ,servicessupportsUsdserviceActivity         VARCHAR(11) NOT NULL
  ,servicessupportsChargeRubserviceCapability VARCHAR(11) NOT NULL
  ,servicessupportsChargeRubserviceActivity   VARCHAR(11) NOT NULL
  ,servicessupportsEurserviceCapability       VARCHAR(11) NOT NULL
  ,servicessupportsEurserviceActivity         VARCHAR(11) NOT NULL
  ,servicessupportsRubserviceCapability       VARCHAR(9) NOT NULL
  ,servicessupportsRubserviceActivity         VARCHAR(11) NOT NULL
);
